function imgLike(n){if(!isAuthenticated){alert("You must login to like or comment.");return}var t=findAncestor(n,"grid-element"),i={ContentId:t.id};$.ajax({type:"POST",url:"/PhotoWall/LikeImg",dataType:"json",contentType:"application/json",data:JSON.stringify(i),success:function(){},error:function(){}})}function findAncestor(n,t){while((n=n.parentElement)&&!n.classList.contains(t));return n}